import Login from "./components/Login";
import { UserContext } from "./components/Login";

function App() {

  const user = {
    userEmail : "",
    userPassword: ""
  }

  return (
    <div>
      <UserContext.Provider value={user}>
        <Login />
      </UserContext.Provider>
    </div>
  );
}

export default App;
